class EncRtdIf(Mo):
    """
    The routed interface corresponds to a sub-interface in Cisco?s routing terminology. A sub-interface is a logical L3 interface created on an underlying physical L3 port (the parent interface). Each sub-interface is associated with an 802.1Q VLAN tag. The traffic that comes on the parent interface with that tag is considered for that sub-interface.     The existence of a routed interface under a VRF or infra VRF also implies that the interface belongs to that VRF. An L3 interface can only belong to one VRF at a time. 

    """

